Here's a simple quiz formatted in JSON, focused on a sofa:

```json
{
    "QuizzedObjectName": "Sofa",
    "QuizQuestions": [
        {
            "Question": "What is the purpose of a sofa?",
            "Options": ["To sleep", "To sit", "To cook"],
            "Answer": "To sit"
        },
        {
            "Question": "What item is often found on a sofa?",
            "Options": ["A frying pan", "A blanket", "A bicycle"],
            "Answer": "A blanket"
        },
        {
            "Question": "What is a common material used to make sofas?",
            "Options": ["Wood", "Fabric", "Plastic"],
            "Answer": "Fabric"
        }
    ]
}
```
